    paper: {
      padding: theme.spacing(2),
      textAlign: 'center',
      color: theme.palette.text.secondary,
      height : '100px',
      
    },
  }));


const Event = ({name}) => {
    const classes = useStyles();
    return ( 
        <Paper className={classes.paper}>{name}
        
            <Button color="primary">Primary</Button>
            <Button color="primary">Primary</Button>
        
        </Paper>
        
     );
}
 
export default Event;
